css:
@-moz-document domain("redfin.com") {
/* Reset */
.experiment-white-bg { 
    background: transparent;
}

body {
    background: #444;
    color: #eee;
}

a {
    color: hsl(194, 100%, 70%);
}

#header header.LargeHeader, 
.navigation-bar-variant-section .StickyContainer, 
.experiment-navigation-bar,
.nb-experiment .theme-menu .navigation-link-container a,
#header header.LargeHeader .menuItemClickable
{
    background: #111;
    color: #ddd;
}

.side-bar-content,
.contact-box-container .bookItNowDatePicker, .multiStage-aaq-main-container.withDatePicker .bookItNowDatePicker,
.contact-box-container .bookItNowDatePicker .datePickerContainer, .multiStage-aaq-main-container.withDatePicker .bookItNowDatePicker .datePickerContainer,
.contact-box-container .bookItNowDatePicker .slidingSection, .multiStage-aaq-main-container.withDatePicker .bookItNowDatePicker .slidingSection
{
    background: #666;
    color: #222;
}

.font-color-gray-dark, 
.data-quality a, 
.MortgageCalculatorSummary .values .dot-value-row .value, 
.AmenitiesInfoSection .entryItem, 
.AmenitiesInfoSection .entryItem:not(.agent-only) .entryItemContent,
.AvmSectionContent, 
.AvmGhostTown, 
.button-text
{
    color: #ddd;
}
}
